import React from 'react';
import './css/Circle.css'; // Import your CSS file
import './public/image/profile.'
const CirclePage = () => {
  return (
    <div className="Section"> 
      <div className='Middle'>
        <h1>Hello Dev</h1>
        <h2>I am Subarna Dahal</h2>
      </div>
      <div className='image'>
        <img src={process.env.PUBLIC_URL + '/images/profile.jpg'} alt='imagephot' />
      </div>
    </div>
  );
}

export default CirclePage;
